import React from 'react';
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import './App.css';
import './assets/icon/iconfont.css';
import routes from './routes/index'
class App extends React.Component {
  // constructor() {

  // }
  render() {
    console.log(routes)
    return <div>
      <Router>
        <div>
          {
            routes.map((_, i) => {
              if (_.path == '/login') {
                return <Route key={i} exact path={_.path}
                  render={
                    props => (
                      <_.component {...props} routes={_.routes} />
                    )
                  } />
              }
            })
          }
        </div>
      </Router>
    </div>
  }
}
export default App;
